import * as S from './bloggy.styles';
import * as GS from '../../styles/global';
import Link from 'next/link';

const Bloggy = ({ posts }) => {
	console.log(posts);
	return (
		<S.BlogContainer>
			{/* Left Side */}
			<div>
				{posts.map((post) => {
					return (
						<S.Blog key={post.excerpt}>
							<li>
								<img src={post.feature_image} />
							</li>
							<li>{post.title}</li>
							<li>{post.excerpt}</li>
						</S.Blog>
					);
				})}
			</div>

			{/* Right Side */}
			<div>
				Lorem ipsum dolor, sit amet consectetur adipisicing elit. Exercitationem sapiente dolore
				doloremque quas ipsa tenetur aspernatur, quia numquam expedita! Quasi sed laudantium libero
				quis sequi similique officia ex atque harum.
			</div>
		</S.BlogContainer>
	);
};

export default Bloggy;
